import React from 'react'
import { Content } from './contentStyle'

class content extends React.Component {
    constructor() {
        super()
        this.state = {}
    }

    render() {
        return (
            <Content>
                <div className="contentDate">
                    <h5>Kamis, 13 Maret 2019</h5>
                </div>

                <div className="contentWrap">
                    <div className="contentItem">
                        <img alt="makanan enak" src="https://images.unsplash.com/photo-1482049016688-2d3e1b311543?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=706&q=80" />
                        <div className="rate">
                            <p>4.5</p>
                            <div className="stars">
                                <span className="material-icons"> star</span>
                                <span className="material-icons"> star</span>
                                <span className="material-icons"> star</span>
                                <span className="material-icons"> star</span>
                                <span className="material-icons"> star_half</span>

                            </div>
                        </div>
                    </div>


                </div>
            </Content>
        );
    }
}

export default content
